import { Container, Row, Col } from 'react-bootstrap';

// you can access the sample dataset with:
import movieData from '../../movies.json'
import './App.scss'; 

function App() {
  return (
    <div className="App">
      <Container>
        {
          movieData && movieData.map((movie,key) => {
            return (
              <div>
                {movie.original_title}
              </div>
            )
          })
        }
        {/* <Row>
          <Col>Happy Coding!</Col>
        </Row> */}
      </Container>
    </div>
  );
}

export default App;
